// ContenedorSuperior.js

import React from 'react';

function ContenedorSuperior() {
  return (
    <div className="contenedorSuperior">
      <input type="text" className="busqueda" />
      <button className="boton-con-imagen" onClick={this.handleClick}>
        <img
          src="ruta-de-la-imagen.jpg"
          alt="Texto alternativo de la imagen"
          width="100" // Ancho deseado
          height="100" // Alto deseado
        />
      </button>
    </div>
  );
}

export default ContenedorSuperior;
